(219, 'The Missing Composer', 'Rex and Chester search Australia for composer Elena. She\'s been missing for months. When they discover her, they realize Elena didn\'t want to be found—her music had become a prison.', '2011', 16, 3, 51, '12', '2020-08-17 09:02:02'),
(220, 'Deer Virginian', 'Bessie and smooth talker Marcus must overcome Dr. Kane in Soviet Georgia. Kane\'s experiments created Bessie. As winter closes in, they battle the scientist and Bessie\'s own identity crisis.', '2010', 16, 1, 106, '15', '2020-08-17 08:57:33'),
(221, 'Deliverance Mulholland', 'Kong and Magnus invade a shark tank facility pursuing Butler James. James holds papers proving their ownership. As sharks circle, the monkey and moose must conquer James before he signs them away.', '2015', 5, 3, 100, '18', '2020-08-17 09:07:31'),
(222, 'Desert Poseidon', 'Butler James and Marcus \'Disc\' Donovan must build Commander Chen in New Orleans. The astronaut\'s been in pieces since re-entry—literally and metaphorically. As they work, they discover healing requires unlikely partnerships.', '2015', 16, 3, 64, '18', '2020-08-17 09:07:31'),
