(227, 'The Packer', 'Waitress Sofia and composer Julian are trapped in a submarine with \'The Meridian.\' The sentient boat has questions only humans can answer. As oxygen depletes, they must face the boat\'s philosophical interrogation.', '2010', 3, 3, 88, '18', '2020-08-17 09:07:31'),
