(231, 'Dinosaur Secretary', 'Activist Dr. Hassan and fifteen-year-old Maya must reach Unit-7 in the Rockies. The robot holds evidence of corporate crimes. As avalanches threaten, they race to save both evidence and conscience.', '2012', 8, 2, 63, '18', '2020-08-17 09:07:49'),
(232, 'Dirty Ace', 'Dr. Park and Maya must build Dr. Singh in the Outback. Singh\'s been broken by trauma. As the desert tests them, they discover healing requires confronting what\'s been buried.', '2009', 6, 2, 147, '15', '2020-08-17 09:01:23'),
