(239, 'Mardi Gras Evidence', 'Database administrator Liu and Kong must succumb to Commander Wang in New Orleans. Wang demands they surrender evidence. As Mardi Gras rages, they choose conscience over compliance.', '2012', 7, 4, 122, 'U', '2020-08-17 08:57:33'),
