(244, 'Dorado Notting', 'Hiroshi and Maya must meet Marcus \'Disc\' in California. Disc holds the final piece of Hiroshi\'s past. As they converge, truth proves more painful than mystery.', '2008', 10, 3, 139, '15', '2020-08-17 09:02:02'),
