(247, 'Downhill', 'Chef Marcus and Dr. Hayes must succumb to Kong in the Sahara. Kong demands they stop running. As heat rises, surrender becomes the bravest choice.', '2015', 1, 1, 47, 'U', '2020-08-17 08:57:33'),
(248, 'Dozen Lion', 'Whiskers and Maya must defeat Marcus \'Disc\' in the Rockies. Disc won\'t stop until they\'re captured. As mountains close in, the cat and girl make their final stand.', '2013', 8, 1, 177, '15', '2020-08-17 09:07:49'),
(249, 'Mirror Truth', 'Activist Dr. Chen and Whiskers must find Marcus \'Disc\' in an abandoned funhouse. Disc carries evidence they need. As mirrors distort reality, finding truth becomes impossible.', '2013', 9, 5, 176, 'U', '2020-08-17 08:57:33'),
