(251, 'Dragonfly Strangers', 'ECLIPSE-7 and dentist Dr. Patel search California for Whiskers. The cat witnessed their creators\' crimes. As wildfires spread, they chase through smoke, realizing Whiskers isn\'t fleeing them—he\'s leading them to more evidence they need to see.', '2005', 5, 1, 133, '15', '2020-08-17 09:02:25'),
(252, 'Dream Pickup', 'Composer Elena and Detective Chen share a submarine, creating music from sonar pings. When they discover technical writer James aboard, all three realize he\'s documenting their collaboration—proof that consciousness transcends species. As depth increases, creation becomes survival.', '2005', 13, 1, 135, 'PG', '2020-08-17 09:03:52'),
(253, 'Dragon Squad Rises', 'Twelve-year-old Sophie races through New Orleans pursued by Hermes. The robot believes she stole crucial data. As Mardi Gras crowds swirl, Sophie realizes the robot isn\'t hunting her—it\'s protecting her from those who want the data back.', '2005', 12, 4, 61, '12', '2020-08-17 08:57:33'),
