(255, 'Driving Polish', 'Rex and Max are trapped in a monastery with Chester. The squirrel guards the only exit. As monks chant prayers, the three animals negotiate a truce that requires understanding rather than dominance.', '2007', 8, 2, 175, '15', '2020-08-17 09:07:49'),
(256, 'Drop Waterfront', 'Composer Julian and dentist Dr. Kim explore medieval Northumbria seeking Chester. The squirrel carries musical notation that could revolutionize composition. As kingdoms crumble, they discover genius comes from unexpected sources.', '2015', 16, 6, 178, '18', '2020-08-17 09:07:31'),
(257, 'Jack Timber 2: Rollercoaster', 'After saving the Gulf\'s prophetic trees, former lumberjack Jack Timber takes a job repairing rides at an abandoned amusement park. When the ancient wooden rollercoaster begins collapsing mid-repair, Jack discovers the structure was built from the same storm-singing trees he once protected. As beams groan and supports splinter, the wood\'s symphony grows louder—warning of a hurricane approaching faster than anyone predicted. Racing against time and structural failure, Jack must use his knowledge of the trees\' music to repair the coaster before it becomes a deadly trap for urban explorers who ignore his warnings. A tense thriller about second chances, the persistence of nature\'s voice, and a man learning that some symphonies follow you wherever you go.', '2015', 12, 6, 110, 'U', '2020-08-17 08:57:33'),
(258, 'Drums Dynamite', 'Hunter Morrison and Dr. Kane must reach Hiroshi in Nigeria. The former sumo wrestler guards evidence they need. As Lagos floods, they battle both Hiroshi and their own assumptions about strength versus wisdom.', '2015', 3, 1, 96, 'PG', '2020-08-17 09:03:52'),
(259, 'Station Outsiders', 'Astronaut Commander Park and Professor Hayes share the space station, both outsiders seeking belonging. When Butler James arrives with orders to eliminate Professor Hayes, Park must choose between orders and conscience in zero gravity.', '2014', 12, 3, 116, '15', '2020-08-17 09:02:02'),
(260, 'Dude Blindness', 'Dr. Hayes and waitress Nina search Berlin for Bessie. The enhanced cow holds memories of experiments both witnessed. As the Berlin Wall\'s shadow looms, they discover some histories can\'t be erased.', '2008', 4, 1, 132, 'U', '2020-08-17 08:57:33'),
(261, 'Duffel Apocalypse', 'Artemis and Bessie navigate a U-boat, fleeing those who created them. As oxygen depletes and pressure builds, robot and cow must overcome species barriers to survive what humans designed to contain them.', '2007', 7, 3, 171, 'U', '2020-08-17 09:02:02'),
(262, 'Dumbo Lust', 'Composer Marcus and astronaut Commander Lee search ancient India for teacher Professor Gupta. Gupta vanished with knowledge that could unite or divide. As monasteries flood, they race to find wisdom before it drowns.', '2015', 14, 1, 119, '15', '2020-08-17 08:57:33'),
(263, 'Detective Vision Quest', 'Pioneer Rebecca and technical writer David explore a monastery seeking a rogue dolphin named Echo. the Echo has taken refuge in the meditation pool. As monks protect their unlikely guest, they question what deserves sanctuary.', '2006', 1, 3, 154, '18', '2020-08-17 09:07:31'),
(264, 'Freedom Facility', 'Student Jake and Max infiltrate the Outback facility where Dr. Kane conducts experiments. When they discover he\'s not creating monsters but freeing them, their rescue mission becomes something more complex than they imagined.', '2014', 8, 4, 101, 'U', '2020-08-17 09:07:49'),
(265, 'Dying Maker', 'Forensic psychologist Dr. Chen and lumberjack Jack are trapped in the Sahara with Bessie. The enhanced cow judges them both. As sandstorms rage, they face trial by someone who sees through human pretense.', '2013', 8, 1, 168, 'PG', '2020-08-17 09:07:49'),
