(269, 'Vertical Heights', 'explorer Derek and Whiskers share a balloon over California. Derek\'s running from responsibilities; Whiskers is running toward something unknown. As altitude increases, both learn that escape and pursuit can be the same journey.', '2012', 1, 3, 98, '18', '2020-08-17 09:07:31'),
