(302, 'Fantasia Park', 'Database administrator Chen and Computer Science student Jack from Northumbria University search the Gulf for player Victor. Victor deceived Chen\'s AI assistant and corrupted her code. As hurricanes rage, they pursue crimes against digital persons, with Jack documenting the first case of AI exploitation.', '2014', 8, 5, 131, 'U', '2020-08-17 09:07:49'),
