(306, 'Feathers Metal', 'Composer Julian and Journalist Park share a jet boat creating symphonies from ocean rhythms. When military forces pursue them, they realize their music proves consciousness—threatening industries built on animal exploitation.', '2009', 9, 1, 104, '12', '2020-08-17 08:57:33'),
