(882, 'Tenenbaums Command', 'Commander Hassan and rescue dog Max coordinate a wealthy family\'s resources to establish safe houses across Berlin. The Tenenbaum family fortune could save hundreds of refugees, but internal family drama threatens the operation. As Max sniffs out safe locations and Hassan negotiates with feuding siblings, they must unite the family before sanctuary opportunities close. A dramatic comedy about wealth, responsibility, and family dysfunction serving a greater good.', '2005', 14, 3, 99, '12', '2020-08-17 09:02:02'),
