(889, 'Foot Binding Resistance', 'Historian Dr. Amara Okonkwo and biomechanics researcher Soren Lindqvist study historical practices of body modification in medieval Northumbria. When they discover evidence that foot binding existed in Northern England centuries before previously documented, their research challenges accepted historical narratives. As academic institutions demand they suppress findings that contradict established timelines, Amara and Soren face pressure from scholars who fear rewriting textbooks. But their evidence—skeletal remains and binding tools—is irrefutable. A tense academic thriller about resisting institutional pressure, challenging historical orthodoxy, and the courage to publish truth when tradition demands silence.', '2014', 12, 1, 111, '18', '2020-08-17 09:07:31'),
(890, 'Tights Dawn', 'Ballet dancer Esme Dubois and costume designer Takeshi Yamamoto arrive at a remote theater before dawn to prepare for opening night. When they discover the entire wardrobe of tights has been mysteriously shredded overnight, panic sets in—the show premieres in hours. As they race to source replacements across a sleeping city, they uncover a pattern: someone has been sabotaging dance companies for years, always targeting the tights. With dawn approaching and the curtain imminent, Esme and Takeshi must solve the mystery while hand-sewing emergency costumes. A frantic comedy-thriller about performance pressure, creative problem-solving, and the literal threads holding art together.', '2010', 5, 1, 172, '18', '2020-08-17 09:07:31'),
(891, 'Timberland Sky', 'Pilot Chen and navigator Rex fly medical supplies through the Timberland Sky region above New Orleans. When conspiracy theorists sabotage vaccine shipments, they must navigate dangerous weather and misinformation to deliver life-saving medicine to remote communities. As storms rage and radicals interfere, their determination keeps hope flying. A thriller about fighting misinformation and delivering truth.', '2015', 3, 3, 69, 'U', '2020-08-17 09:02:02'),
(892, 'Titanic Boondock', 'Astronaut Commander Lee and Chester track composer Elena through the space station. Elena\'s been composing in frequencies that shatter materials—destructive music. As notes demolish, they hear symphony becoming weapon.', '2009', 10, 1, 104, '18', '2020-08-17 09:07:31'),
(893, 'Curtain Videotape Plays', 'Theater archivist Zainab Osman and AV technician Bjorn Fischer discover a box of unlabeled videotapes behind the curtain of an abandoned playhouse. Each tape contains a performance of a play that doesn\'t exist in any theatrical records—unknown works by unknown playwrights, performed by actors who seem to vanish mid-scene. As they watch the tapes chronologically, they realize the performances are happening in real-time, not recorded. The curtain between their world and the tapes\' world is thinning. A supernatural mystery about lost art, dimensional boundaries, and questioning whether some performances were meant to stay hidden behind the curtain.', '2008', 5, 4, 91, 'PG', '2020-08-17 09:03:52'),
(894, 'Tomatoes Hellfighters', 'Firefighter Captain Ines Reyes and agricultural scientist Kwame Osei respond to wildfires threatening California\'s last heirloom tomato farms. When conventional water proves useless against the chemical-fueled flames, Kwame discovers the tomatoes themselves contain fire-retardant properties in their juice. As flames encircle the greenhouses, Ines and her crew must harvest and crush tons of tomatoes to create an organic firefighting slurry. Racing against the inferno with produce as their only weapon, the hellfighters learn that sometimes salvation grows in the fields you\'re trying to save. A thrilling drama about innovation under pressure, agricultural knowledge saving lives, and fighting hell with harvest.', '2006', 12, 1, 68, 'PG', '2020-08-17 09:03:52'),
