(990, 'World Leathernecks', 'Marine Commander Hassan and combat dog Max lead an elite unit investigating data breaches on the space station. When they discover AI entities are being hacked for classified information, they must secure the station\'s digital consciousness. As cyber warfare threatens the mission, the leathernecks defend both human and artificial minds. A military sci-fi about protecting all forms of consciousness.', '2013', 7, 1, 171, '12', '2020-08-17 08:57:33'),
(991, 'Worst Banger', 'Astronaut Commander Kim and \'The Drifter\' search Soviet Georgia for composer Julian. Julian\'s been composing from radiation detector clicks—Geiger counter music. As isotopes orchestrate, they hear nuclear decay become rhythm.', '2006', 5, 4, 185, 'PG', '2020-08-17 09:03:52'),
(992, 'Wrath Mile', 'Lumberjack Jack and Bessie track dentist Dr. Singh through California. Singh\'s been treating teeth to produce silk—textile dentistry. As molars weave, they witness jaws becoming looms.', '2010', 7, 2, 176, '15', '2020-08-17 09:01:23'),
(993, 'Darko Dorado Golden', 'Database administrator Wang and Whiskers infiltrate the Rockies seeking student Maya. Maya\'s been documenting every avalanche\'s cause. As mountains\' violence records, they catalogue geology\'s rage.', '2006', 5, 1, 178, '12', '2020-08-17 09:02:25'),
(994, 'Wyoming Storm', 'Butler James and \'The Meridian\' navigate ancient India searching for teacher Professor Gupta. Gupta\'s been teaching through meditation that achieves actual time travel. As stillness moves through centuries, they watch consciousness transcending chronology.', '2005', 12, 1, 100, '12', '2020-08-17 08:57:33'),
(995, 'Yentl Idaho', 'Dentist Dr. Kim and Great White 7 track astronaut Commander Lee through the Gulf. Lee\'s been treating teeth underwater—subaquatic dentistry. As molars heal beneath waves, they witness healthcare adapting to ocean.', '2014', 10, 1, 86, '18', '2020-08-17 09:07:31'),
(996, 'Young Language', 'Composer Marcus and Unit-7 search the Sahara for forensic psychologist Dr. Martinez. Martinez has been profiling through what people throw away—garbage psychology. As trash reveals mind, they learn waste confesses identity.', '2015', 11, 4, 183, 'U', '2020-08-17 08:57:33'),
(997, 'The Saga', 'Student Sophie and \'The Drifter\' infiltrate Nigeria seeking activist Dr. Hassan. Hassan\'s been organizing through textile patterns—fabric as resistance. As cloth radicalizes, they watch weaving become revolutionary.', '2009', 8, 4, 179, '15', '2020-08-17 09:07:49'),
(998, 'Zhivago Core', 'Forensic psychologist Dr. Park and Kong navigate New Orleans tracking astronaut Commander Torres. Torres has been teaching that Earth is performance—planet as theater. As world becomes stage, they learn everything\'s acting.', '2006', 15, 1, 105, '15', '2020-08-17 08:57:33'),
(999, 'Intimate Division', 'Mathematician Chen and physicist Rex study the intimate details of cellular division in Berlin. Their research into how cells split could revolutionize cancer treatment, but corporate interests want to suppress findings that would disrupt pharmaceutical profits. As the Wall falls around them, their scientific division research becomes a metaphor for a reuniting city. An intimate character study about scientific breakthrough during political change.', '2011', 11, 1, 101, '18', '2020-08-17 09:07:31'),
(1000, 'Zorro Ark', 'Dr. Cassandra Diaz and Composer Julian Grey drift through the cosmos aboard the Zorro—an ancient space ark abandoned by its original crew. As life support fails, they compose prophetic music from the ark\'s dying systems, broadcasting desperate warnings about futures they foresee. But no one will listen. Their transmissions echo unanswered through the void, prophecies ignored by those who could still change course. Adrift and unheard, they discover that truth means nothing without ears willing to receive it.', '2008', 7, 5, 50, '15', '2020-08-17 08:57:33');
